import React from "react";
import Section from "../../atom/section";
import RegisterForm from "../Modal/component/registerForm";

export default function Register(props) {
  const registerStyle = {
    backgroundColor: "white",
  };

  return (
    <main style={registerStyle}>
      <Section
        className="register"
        title="đăng ký"
        type="thực chiến front-end căn bản"
      >
        <RegisterForm />
      </Section>
    </main>
  );
}
